import { Col, Container, Row, Form, Button } from 'react-bootstrap';
import Card from 'react-bootstrap/Card'

function App() {
  const nums = [1, 2, 3, 4, 5, 6, 7, 8, 9, 0, ","]
  return (
    <div className="App">
       <Container>
        <Row>
          <Col xs={12} lg={6} xl={3}>
          <Card>
          <Card.Body>
          <Form.Control className={'mb-2'} size="lg" type="text" placeholder="0" />
            {nums.map((b) => 
              <Button className={'me-1 mb-1'} variant={'dark'} key={b}>{b}</Button>
            )
            }
          </Card.Body>
        </Card>
          </Col>
        </Row>
       </Container>

    </div>
  );
}

export default App;
